import React from 'react';
// styles
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';

// Formsコンポーネント
import { Name } from '../Forms/Name';
import { Email } from '../Forms/Email';
import { Password } from '../Forms/Password';
import { PasswordConfirmation } from '../Forms/PasswordConfirmation';

export const SignUpDialog = ({
  open,
  handleClose,
  handleSubmit,
  name,
  email,
  password,
  passwordConfirmation,
  inputName,
  inputEmail,
  inputPassword,
  inputPasswordConfirmation,
}) => {

  // 新規登録ダイアログの内容を返す
  return (
    <Dialog
      open={open}
      onClose={handleClose}
    >
      <DialogTitle>
        新規登録
      </DialogTitle>
      <DialogContent>
        <DialogContentText>
          下記項目を入力し「登録する」を押してください。
        </DialogContentText>

        <Name
          name={name}
          handleChange={e => inputName(e.target.value)}
        />
        <Email
          email={email}
          handleChange={e => inputEmail(e.target.value)}
        />
        <Password
          password={password}
          handleChange={e => inputPassword(e.target.value)}
        />
        <PasswordConfirmation
          passwordConfirmation={passwordConfirmation}
          handleChange={e => inputPasswordConfirmaiton(e.target.value)}
        />

      </DialogContent>

      <DialogActions>
        <Button onClick={() => handleClose()}>
          閉じる
        </Button>
        <Button onClick={() => handleSubmit()} type='submit'>
          登録する
        </Button>
      </DialogActions>
    </Dialog>
  );
}
